import { css } from '@emotion/css';

export const styLabel = css`
  text-decoration: none;
  margin-bottom: 5px;
`;

export const styContainer = css`
  width: 100%;
`;

export const styTextInput = css`
  border: 1px solid #808080;
  border-radius: 3px;
  padding: 5px;
  color: #000;
  text-decoration: none;
  height: 25px;
  justify-content: center;
  font-size: 12px;
  width: 90%;
`;
